import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { Notifications } from './Notifications';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />

  </React.StrictMode>
);

ReactDOM.render(
  <React.StrictMode>
    <div id="root-notifications"></div> {/* Create the root-notifications div */}
  </React.StrictMode>,
  document.getElementById('root-notifications')
);

// Render the Notifications component within the "root-notifications" div
ReactDOM.render(<Notifications />, document.getElementById('root-notifications'));
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
